import React, { useState } from "react";

const counter = () => {
  const [count, setCount] = useState(0);
  return (
    <div>
      <h2>Counter</h2>
      <button onClick={() => setCount(count + 1)}>+</button>
      <span>{count}</span>
      {/* <button onClick={decrement}> -</button> */}
    </div>
  );
};

export default counter;
